import React from "react";
// import ReactWOW from "react-wow";

const ThankYouWedding = () => (
  <section
    className="parallax-bg-6 fixed-bg"
    data-stellar-background-ratio="0.2"
  >
    <div className="overlay-bg"></div>
    <div className="container">
      <div className="row">
        <div className="col-md-8 text-center offset-md-2 white-color">
          {/* <ReactWOW animation="fadeInUp" delay="0.2s"> */}
            <h1 className="cardo-font">Thank You For Watching Us</h1>
          {/* </ReactWOW> */}
          {/* <ReactWOW animation="fadeInUp" delay="0.3s"> */}
            <h2 className="cardo-font mt-30">DANIEL & OLIVIA</h2>
          {/* </ReactWOW> */}
        </div>
      </div>
    </div>
  </section>
);

export default ThankYouWedding;
